'use strict';
class PLCalculationPathItem {
    offerId;
    inverseConversion;
    isInverseConversion() {
        return this.inverseConversion;
    }
    getOfferId() {
        return this.offerId;
    }
    static create(oper, offerId) {
        let instance;
        instance = new PLCalculationPathItem();
        instance.inverseConversion = oper == "\\";
        instance.offerId = offerId;
        return instance;
    }
    static getPLCalculationPathItem(legs, index) {
        return legs.get(index);
    }
}
module.exports = PLCalculationPathItem
